import httpclient from '@/utils/httpclient';
import { getDateString } from "../../../utils/date";
export default {
  name: "alerts",
  data: function data() {
    return {
      currentPage: 1,
      pageSize: 10,
      total: 0,
      show: false,
      tableFields: {
        alertType: {
          label: "Alert Type",
          class: "text-center"
        },
        vehicle: {
          label: "Vehicle",
          class: "text-center"
        },
        stockNo: {
          label: "Stock NO.",
          class: "text-center"
        },
        time: {
          label: "Time",
          class: "text-center"
        },
        status: {
          label: "Status",
          class: "text-center"
        },
        action: {
          label: "Actions",
          class: "text-center"
        }
      },
      data: null,
      table: null,
      pageCount: 0,
      updateInfo: ''
    };
  },
  mounted: function mounted() {
    this.axiosData(this.currentPage);
  },
  methods: {
    axiosData: function axiosData(pageNo) {
      var _this = this;

      httpclient.post("/api/v1/alert/list?pageNo=".concat(pageNo, "&pageSize=10")).then(function (response) {
        console.log(response);
        _this.currentPage = response.data.data.pageNo;
        _this.total = response.data.data.rowCount;
        _this.data = response.data.data;
        _this.pageCount = response.data.data.totalPages;

        _this.filterData();
      });
    },
    filterData: function filterData() {
      this.table = this.data.datas.map(function (item) {
        var year = item.year ? item.year : 'N/A';
        var make = item.make ? item.make : 'N/A';
        var model = item.model ? item.model : 'N/A';
        return {
          "alertType": item.alertTypeName,
          "vehicle": "".concat(year, " ").concat(make, " ").concat(model),
          "stockNo": item.stockNum ? item.stockNum : 'N/A',
          "time": item.createTime ? getDateString(item.createTime) : 'N/A',
          "status": item.alertStatus,
          'id': item.id
        };
      });
    },
    changeFL: function changeFL(type) {
      this.axiosData(type == 'f' ? 1 : this.pageCount);
    },
    prevPage: function prevPage() {
      this.axiosData(this.currentPage > 1 ? this.currentPage - 1 : 1);
    },
    nextPage: function nextPage() {
      this.axiosData(this.currentPage >= this.pageCount ? this.currentPage : this.currentPage + 1);
    },
    changePage: function changePage(page) {
      console.log(page);
      this.axiosData(page);
    },
    reload: function reload() {
      window.location.reload();
    },
    updateVehicle: function updateVehicle(id) {
      var self = this;
      httpclient.post('/api/v1/alert/update/status', {
        alertId: id
      }).then(function (response) {
        if (response.data.code == 200) {
          self.updateInfo = 'The alert status has been modified';
          self.show = true;
        } else {
          self.updateInfo = 'update error';
          self.show = true;
        }
      }).catch(function (error) {});
    }
  }
};
